        private static bool ER_ParseLegs(NHibernate.ISession session,int groupsCount,QuickFix.FIX44.ExecutionReport msg,int parentid)
        {
            int groupFieldNo = 555;
           
            for (int i = 0; i < groupsCount;i++)
            {
                ErLeg dbgrp = new ErLeg();
                QuickFix.Group group=msg.GetGroup(i+1, groupFieldNo);
                if (group.IsSetField(600))
                    dbgrp.Legsymbol = group.GetField(600);
                if (group.IsSetField(607))
                    dbgrp.Legproduct = Convert.ToInt16(group.GetField(607));
                if (group.IsSetField(609))
                    dbgrp.Legsecuritytype = group.GetField(609);
                if (group.IsSetField(624))
                    dbgrp.Legside = Convert.ToInt16(group.GetField(624));
                if (group.IsSetField(556))
                    dbgrp.Legcurrency = group.GetField(556);
                if (group.IsSetField(687))
                    dbgrp.Legqty = ParseToDouble(group.GetField(687));
                if (group.IsSetField(654))
                    dbgrp.Legrefid = group.GetField(654);
                if (group.IsSetField(587))
                    dbgrp.Legsettltype = group.GetField(587);
                if (group.IsSetField(588))
                    dbgrp.Legsettldate = DateTime.ParseExact(group.GetField(588), "yyyyMMdd", CultureInfo.InvariantCulture);
                if (group.IsSetField(637))
                    dbgrp.Leglastpx = ParseToDouble(group.GetField(637));
                if (group.IsSetField(1073))
