        private static bool ER_ParseParties(NHibernate.ISession session, int groupsCount, QuickFix.FIX44.ExecutionReport msg, int parentid)
        {
            int subsCount;
            for (int i = 0; i < groupsCount; i++)
            {
                subsCount = 0;
                ErParty dbgrp = new ErParty();
                QuickFix.FIX44.ExecutionReport.NoPartyIDsGroup partygroup = new QuickFix.FIX44.ExecutionReport.NoPartyIDsGroup();
                msg.GetGroup(i + 1, partygroup);
                dbgrp.Erid = parentid;
                if (partygroup.IsSetPartyID())
                    dbgrp.Partyid = partygroup.PartyID.getValue();
                if (partygroup.IsSetPartyRole())
                    dbgrp.Partyidrole = (short)partygroup.PartyRole.getValue();
                if (partygroup.IsSetPartyIDSource())
                    dbgrp.Partyidsource = partygroup.PartyIDSource.getValue().ToString();
                if (partygroup.IsSetNoPartySubIDs())
                    subsCount = partygroup.NoPartySubIDs.getValue();
                dbgrp.Partyno = i + 1;
                session.Save(dbgrp);
                ER_ParsePartySubs(session, subsCount, partygroup, dbgrp.Id);
            }
            return true;
        }

